### Особенности региона ###

Город Бенидорм в провинции Аликанте с его шестикилометровой набережной пестрит небоскребами и развлекательными заведениями. При этом пляжи здесь считаются одними из лучших на Средиземноморском побережье и ежегодно принимают тысячи туристов. Из неоспоримых достоинств этого региона следует отметить:

* благоприятный средиземноморский климат, подступающие со стороны материка горы, тёплые зимы;
* жилые комплексы с видами на море в городе с развитой инфраструктурой, спортивным и культурным досугом;
* парки развлечений, включая популярный «Терра Митика».
